	eval("module.exports = \"<h1 class=\\\"heading-xlarge\\\">\\n  Single Page<br/>Platform Development Kit\\n</h1>\\n\\n<div class=\\\"text\\\">\\n  <p class=\\\"lede\\\">\\n    This Platform development kit includes and extends the GDS GOV.UK packages for developing citizen and business facing services as a platform.\\n  </p>\\n</div>\\n<h2 class=\\\"heading-small heading-contents\\\">Contents:</h2>\\n<div class=\\\"grid-row\\\">\\n  <div class=\\\"column-two-thirds\\\">\\n    <ul class=\\\"list list-contents\\\">\\n      <li><a ui-sref=\\\"home({'#':'pdk-what'})\\\" href=\\\"#\\\" href=\\\"#\\\">What is the PDK?</a></li>\\n      <li><a ui-sref=\\\"home({'#':'pdk-principles'})\\\" href=\\\"#\\\">Principles</a></li>\\n      <li><a ui-sref=\\\"home({'#':'pdk-getting-started'})\\\" href=\\\"#pdk-getting-started\\\">Getting started</a></li>\\n      <li><a ui-sref=\\\"home({'#':'pdk-packages'})\\\" href=\\\"#\\\">Packages</a></li>\\n      <li><a ui-sref=\\\"home({'#':'pdk-contribute'})\\\" href=\\\"#\\\">Contribute</a></li>\\n    </ul>\\n  </div>\\n</div>\\n\\n<h2 class=\\\"heading-large\\\" id=\\\"pdk-what\\\">What is the PDK?</h2>\\n<div class=\\\"text\\\">\\n  <p>\\n    The PDK is a platform used to make single page applications that deliver government services. It consists of two parts, the feature rich “platform components” and the “platform templates” they contain extendable JavaScript modules and a library of styles respectively. The components and templates provide a complete solution to create business and citizen facing services that are; scalable, intuitive, accessibility compliant and provide a robust user experience. The following principles are the driving force behind the PDK; User Driven Experience, Domain Driven Design, Extendable Governance, Automated Assurance, Continuous Improvement and Openness.\\n  </p>\\n  <br>\\n  <p>\\n    The functionality and esthetics of the platform are based on Government Digital Services (GDS), who are leading the digital transformation of the UK government. GDS guidelines are used as a blueprint to create each individual element inside the platform, ensuring the final product is consistent and compliments the wider digital transformation. Modern technological solutions have been used to enforce usability and underline capabilities of the PDK.      \\n  </p>\\n</div>   \\n\\n<h2 class=\\\"heading-large\\\" id=\\\"pdk-principles\\\">Principles</h2>\\n<div class=\\\"text\\\">\\n  <p>\\n    Why we created this development kit and the principles it was founded on.\\n  </p>\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">User driven experience</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p>\\n        Providing a good experience for the end user is a priority and is evident throughout the PDK. A user centric approach is demonstrated by the initial efforts of solution designers and user experience (UX) experts guided by valuable user research. This platform has been developed in partnership with design, UX and research teams which has resulted in a user friendly final product. The platform is flexible and can be used to develop business and citizen facing services. Furthermore a tailored user experience can be developed to meet the expectations of various end users especially those accustomed to the GDS guidelines.\\n      </p>\\n      <br>\\n      <p>The development team have utilised technological solutions to ensure that the PDK is accessible for all types of users including those that are visually impaired. To solve this challenge the platform facilitates the development of Accessible Rich Internet Applications (ARIA). It’s robust UX capabilities are demonstrated further by multiple platform availability and accessibility across a range of devices via an adaptive responsive layout. So development teams can be assured their services are developed with an optimum user driven experience.</p>\\n    </div>\\n  </details>\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Domain driven design</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p>\\n        It is beneficial to adopt a well structured approach when developing complex software. The PDK adheres to Domain Driven Design (DDD) principles. This is demonstrated in the components section which provides a set of elements organised by domain. One crucial benefit is the creation of a ubiquitous language understood by domain experts, technical teams, solution designers and user experience teams. The later helps promote consolidation and frequent merging of ideas and code sources, reduces the rate of fragmentation during the product lifecycle.\\n      </p>\\n    </div>\\n  </details>\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Extendable governance</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p>\\n        To maintain consistency across services it is crucial to have generic reusable, styles, features and components that remain extendable.\\n      </p>\\n    </div>\\n  </details>\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Automated assurance</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p>\\n        The PDK contains a suite of automated unit tests and end to end tests validating the front-end data model and user interface. This guarantees a high test coverage of services using the kit as a core library. Each feature must have passing tests before being deployed to a server where Jenkins runs continuous integration tests.\\n      </p>\\n      <br>\\n      <p>Automated assurance is one of the main benefits of using the PDK. The technical team conducted a test driven development approach. The positive impact of this reaches quality analysts and end users who have a consistent and positive user experience. It is vital that service users are comfortable and have confidence regarding their expectations.</p>\\n    </div>\\n  </details>\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Continuous improvement</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p>\\n        The developers of the PDK follow agile principles and continuously push to make improvements. This is demonstrated by the use of code review tools such as gerrit.\\n      </p>\\n    </div>\\n  </details>\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Openness</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p>\\n        Hosted on github and accessible for the public development community to contribute to the project. This promotes collaboration with the wider engineering community resulting in better quality code.\\n      </p>\\n    </div>\\n  </details>\\n</div>\\n\\n\\n\\n<h2 class=\\\"heading-large\\\" id=\\\"pdk-getting-started\\\">Getting started</h2>\\n<div class=\\\"text\\\">\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Prerequisite software</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <ol>\\n        <li>\\n          Git\\n        </li>\\n        <li>\\n          Node\\n        </li>\\n      </ol>\\n    </div>\\n  </details>\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Installation</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p><span class=\\\"bold-small\\\">npm install</span></p>\\n    </div>\\n  </details>\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Serve</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p><span class=\\\"bold-small\\\">npm start</span> - to build your client app and start a webserver.</p>\\n    </div>\\n  </details>\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Development</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p><span class=\\\"bold-small\\\">npm start</span> - to allow file changes to update in realtime.</p>\\n    </div>\\n  </details>\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Distribute</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p><span class=\\\"bold-small\\\">npm run build_dev</span> - to prepare a distributable bundle.</p>\\n    </div>\\n  </details>\\n</div>\\n<h2 class=\\\"heading-large\\\" id=\\\"pdk-packages\\\">Packages</h2>\\n<div class=\\\"text\\\">\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Platform components</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <span class=\\\"bold-small\\\">npm i @govuk/angularjs-components</span> - to install the platform components. This includes the core JavaScript modules.\\n    </div>\\n  </details>\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Platform templates</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <span class=\\\"bold-small\\\">npm i @govuk/platform-template</span> - to install the platform template. This includes the core style library.\\n    </div>\\n  </details>\\n</div>\\n<h2 class=\\\"heading-large\\\" id=\\\"pdk-contribute\\\" >Contribute</h2>\\n<div class=\\\"text\\\">\\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">How can developers contribute?</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p>\\n        Currently the PDK is available for contribution as a whole project including the source code to create this page. Here are some useful folders & files for contributors;\\n      </p>\\n      <br>\\n      <span class=\\\"bold-small\\\">pdk_root/modules/components</span>\\n      <br>\\n      <span class=\\\"bold-small\\\"> pdk_root/modules/content</span>\\n      <br>\\n      <span class=\\\"bold-small\\\">pdk_root/index.scss</span>\\n    </div>\\n  </details> \\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Download the PDK</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p>\\n        The latest stable version of the project source code can be viewed <a href=\\\"https://github.com/CJSCommonPlatform/govuk_single_page_pdk\\\">here</a>.\\n      </p>\\n      <br>\\n      <p>\\n        To clone the project please run: <br><span class=\\\"bold-small\\\">git clone git@github.com:CJSCommonPlatform/govuk_single_page_pdk.git</span>.\\n      </p>\\n      <br>\\n      <p>\\n        The live project is available online and can be viewed <a href=\\\"http://cjscommonplatform.github.io/govuk_single_page_pdk/#/\\\">here</a>.       \\n      </p>\\n      <br>\\n      <p>Navigate into the folder entitled govuk_single_page_pdk and run <span class=\\\"bold-small\\\">npm install</span>.</p>\\n    </div>\\n  </details>  \\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Boilerplate coming soon</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p>The developers behind the PDK are currently creating a boilerplate to help users get projects up and running efficiently.</p>  \\n    </div>\\n  </details> \\n  <details>\\n    <summary>\\n      <span class=\\\"summary bold-small\\\">Angular 2 & Angular Universal docs</span>\\n    </summary>\\n    <div class=\\\"panel panel-border-narrow\\\">\\n      <p>New documentation is currently in the progress to detail services developed using Angular 2 and Angular Universal.</p>  \\n    </div>\\n  </details>  \\n</div>\";//# sourceMappingURL=data:application/json;charset=utf-8;base64,");

