	eval("module.exports = \"<main id=\\\"content\\\" role=\\\"main\\\" tabindex=\\\"-1\\\">\\n\\n  <h1 class=\\\"heading-xlarge\\\">\\n    <span class=\\\"heading-secondary\\\">Layout</span>\\n    Business\\n  </h1>\\n\\n  <div class=\\\"text\\\">\\n    <p class=\\\"lede\\\">\\n      Business facing projects can use Bootstrap grids which includes a responsive, mobile first fluid grid system that\\n      appropriately scales up to 12 columns as the device or viewport size increases. It includes predefined classes for\\n      easy layout options, as well as powerful mixins for generating more semantic layouts.\\n    </p>\\n  </div>\\n\\n  <h2 class=\\\"heading-small heading-contents\\\">Contents:</h2>\\n  <div class=\\\"grid-row\\\">\\n    <div class=\\\"column-two-thirds\\\">\\n      <ul class=\\\"list list-contents\\\">\\n        <li><a ui-sref=\\\"layout.business({'#':'grid-intro'})\\\">Introduction</a></li>\\n        <li><a ui-sref=\\\"layout.business({'#':'grid-media-queries'})\\\">Media queries</a></li>\\n        <li><a ui-sref=\\\"layout.business({'#':'grid-options'})\\\">Grid options</a></li>\\n        <li><a ui-sref=\\\"layout.business({'#':'grid-example-basic'})\\\">Ex: Stacked-to-horizontal</a></li>\\n        <!--<li><a ui-sref=\\\"layout.business({'#':'grid-example-fluid'})\\\">Ex: Fluid container</a></li>-->\\n        <li><a ui-sref=\\\"layout.business({'#':'grid-example-mixed'})\\\">Ex: Mobile and desktop</a></li>\\n        <li><a ui-sref=\\\"layout.business({'#':'grid-example-mixed-complete'})\\\">Ex: Mobile, tablet, desktop</a></li>\\n        <li><a ui-sref=\\\"layout.business({'#':'grid-example-wrapping'})\\\">Ex: Column wrapping</a></li>\\n        <li><a ui-sref=\\\"layout.business({'#':'grid-responsive-resets'})\\\">Responsive column resets</a></li>\\n        <li><a ui-sref=\\\"layout.business({'#':'grid-offsetting'})\\\">Offsetting columns</a></li>\\n        <li><a ui-sref=\\\"layout.business({'#':'grid-nesting'})\\\">Nesting columns</a></li>\\n        <li><a ui-sref=\\\"layout.business({'#':'grid-column-ordering'})\\\">Column ordering</a></li>\\n      </ul>\\n    </div>\\n  </div>\\n\\n  <h3 class=\\\"heading-medium\\\" id=\\\"grid-intro\\\">Introduction</h3>\\n  <ul class=\\\"list-bullet\\\">\\n   <li>Rows must be placed within a .container (fixed-width) or .container-fluid (full-width) for proper alignment and\\n     padding.</li>\\n   <li>Use rows to create horizontal groups of columns.\\n   </li>\\n   <li>Content should be placed within columns, and only columns may be immediate children of rows.\\n   </li>\\n   <li>Predefined grid classes like <code>.row</code> and <code>.col-xs-4</code> are available for quickly making grid\\n     layouts. Less mixins can also be used for more semantic layouts.\\n   </li>\\n   <li>Columns create gutters (gaps between column content) via padding. That padding is offset in rows for the first\\n     and last column via negative margin on <code>.rows</code>.\\n   </li>\\n   <li>The negative margin is why the examples below are outdented. It's so that content within grid columns is lined\\n     up with non-grid content.\\n   </li>\\n   <li>Grid columns are created by specifying the number of twelve available columns you wish to span. For example,\\n     three equal columns would use three <code>.col-xs-4</code>.\\n   </li>\\n   <li>If more than 12 columns are placed within a single row, each group of extra columns will, as one unit, wrap onto\\n     a new line.\\n   </li>\\n   <li>Grid classes apply to devices with screen widths greater than or equal to the breakpoint sizes, and override grid\\n     classes targeted at smaller devices. Therefore, e.g. applying any <code>.col-md-*</code> class to an element will\\n     not only affect its styling on medium devices but also on large devices if a <code>.col-lg-*</code> class is not present.\\n   </li>\\n  </ul>\\n  <h3 class=\\\"heading-medium\\\" id=\\\"grid-media-queries\\\">Media queries</h3>\\n  <p>We use the following media queries in our Less files to create the key breakpoints in our grid system.</p>\\n  <prismify language=\\\"markup\\\">\\n    /* Extra small devices (phones, less than 768px) */\\n    /* No media query since this is the default in Bootstrap */\\n\\n    /* Small devices (tablets, 768px and up) */\\n    @media (min-width: @screen-sm-min) { ... }\\n\\n    /* Medium devices (desktops, 992px and up) */\\n    @media (min-width: @screen-md-min) { ... }\\n\\n    /* Large devices (large desktops, 1200px and up) */\\n    @media (min-width: @screen-lg-min) { ... }\\n  </prismify>\\n  <p>We occasionally expand on these media queries to include a max-width to limit CSS to a narrower set of devices.</p>\\n  <prismify language=\\\"markup\\\">\\n    @media (max-width: @screen-xs-max) { ... }\\n    @media (min-width: @screen-sm-min) and (max-width: @screen-sm-max) { ... }\\n    @media (min-width: @screen-md-min) and (max-width: @screen-md-max) { ... }\\n    @media (min-width: @screen-lg-min) { ... }\\n  </prismify>\\n  <h3 class=\\\"heading-medium\\\" id=\\\"grid-options\\\">Grid options</h3>\\n  <p>See how aspects of the Bootstrap grid system work across multiple devices with a handy table.</p>\\n  <div class=\\\"table-responsive\\\">\\n    <table>\\n      <thead>\\n      <tr>\\n        <th></th>\\n        <th> Extra small devices\\n          <small>Phones (&lt;768px)</small>\\n        </th>\\n        <th> Small devices\\n          <small>Tablets (≥768px)</small>\\n        </th>\\n        <th> Medium devices\\n          <small>Desktops (≥992px)</small>\\n        </th>\\n        <th> Large devices\\n          <small>Desktops (≥1200px)</small>\\n        </th>\\n      </tr>\\n      </thead>\\n      <tbody>\\n      <tr>\\n        <th>Grid behavior</th>\\n        <td>Horizontal at all times</td>\\n        <td colspan=\\\"3\\\">Collapsed to start, horizontal above breakpoints</td>\\n      </tr>\\n      <tr>\\n        <th>Container width</th>\\n        <td>None (auto)</td>\\n        <td>750px</td>\\n        <td>970px</td>\\n        <td>1170px</td>\\n      </tr>\\n      <tr>\\n        <th>Class prefix</th>\\n        <td><code>.col-xs-</code></td>\\n        <td><code>.col-sm-</code></td>\\n        <td><code>.col-md-</code></td>\\n        <td><code>.col-lg-</code></td>\\n      </tr>\\n      <tr>\\n        <th># of columns</th>\\n        <td colspan=\\\"4\\\">12</td>\\n      </tr>\\n      <tr>\\n        <th>Column width</th>\\n        <td>Auto</td>\\n        <td>~62px</td>\\n        <td>~81px</td>\\n        <td>~97px</td>\\n      </tr>\\n      <tr>\\n        <th>Gutter width</th>\\n        <td colspan=\\\"4\\\">30px (15px on each side of a column)</td>\\n      </tr>\\n      <tr>\\n        <th>Nestable</th>\\n        <td colspan=\\\"4\\\">Yes</td>\\n      </tr>\\n      <tr>\\n        <th>Offsets</th>\\n        <td colspan=\\\"4\\\">Yes</td>\\n      </tr>\\n      <tr>\\n        <th>Column ordering</th>\\n        <td colspan=\\\"4\\\">Yes</td>\\n      </tr>\\n      </tbody>\\n    </table>\\n  </div>\\n  <h3 class=\\\"heading-medium\\\" id=\\\"grid-example-basic\\\">Example: Stacked-to-horizontal</h3>\\n  <p>Using a single set of <code>.col-md-*</code> grid classes, you can create a basic grid system that starts out stacked on mobile\\n    devices and tablet devices (the extra small to small range) before becoming horizontal on desktop (medium) devices. Place grid columns in any <code>.row</code>.</p>\\n  <docs-example language=\\\"markup\\\">\\n    <!--12 columns example-->\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-md-1\\\">\\n        .col-md-1\\n      </div>\\n      <div class=\\\"col-md-1\\\">\\n        .col-md-1\\n      </div>\\n      <div class=\\\"col-md-1\\\">\\n        .col-md-1\\n      </div>\\n      <div class=\\\"col-md-1\\\">\\n        .col-md-1\\n      </div>\\n      <div class=\\\"col-md-1\\\">\\n        .col-md-1\\n      </div>\\n      <div class=\\\"col-md-1\\\">\\n        .col-md-1\\n      </div>\\n      <div class=\\\"col-md-1\\\">\\n        .col-md-1\\n      </div>\\n      <div class=\\\"col-md-1\\\">\\n        .col-md-1\\n      </div>\\n      <div class=\\\"col-md-1\\\">\\n        .col-md-1\\n      </div>\\n      <div class=\\\"col-md-1\\\">\\n        .col-md-1\\n      </div>\\n      <div class=\\\"col-md-1\\\">\\n        .col-md-1\\n      </div>\\n      <div class=\\\"col-md-1\\\">\\n        .col-md-1\\n      </div>\\n    </div>\\n\\n    <!--2 unequal columns example-->\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-md-8\\\">\\n        .col-md-8\\n      </div>\\n      <div class=\\\"col-md-4\\\">\\n        .col-md-4\\n      </div>\\n    </div>\\n\\n    <!--3 columns example-->\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-md-4\\\">\\n        .col-md-4\\n      </div>\\n      <div class=\\\"col-md-4\\\">\\n        .col-md-4\\n      </div>\\n      <div class=\\\"col-md-4\\\">\\n        .col-md-4\\n      </div>\\n    </div>\\n\\n    <!--2 equal columns example-->\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-md-6\\\">\\n        .col-md-6\\n      </div>\\n      <div class=\\\"col-md-6\\\">\\n        .col-md-6\\n      </div>\\n    </div>\\n  </docs-example>\\n  <!--<h3 class=\\\"heading-medium\\\" id=\\\"grid-example-fluid\\\">Example: Fluid container</h3>-->\\n  <!--<p>Turn any fixed-width grid layout into a full-width layout by changing your outermost <code>.container</code> to <code>.code</code>.</p>-->\\n  <!--<prismify language=\\\"markup\\\">-->\\n    <!--<div class=\\\"container-fluid\\\">-->\\n      <!--<div class=\\\"row\\\">-->\\n        <!--...-->\\n      <!--</div>-->\\n    <!--</div>-->\\n  <!--</prismify>-->\\n  <h3 class=\\\"heading-medium\\\" id=\\\"grid-example-mixed\\\">Example: Mobile and desktop</h3>\\n  <p>Don't want your columns to simply stack in smaller devices? Use the extra small and medium device grid classes by\\n    adding <code>.col-xs-*</code> <code>.col-md-*</code> to your columns. See the example below for a better idea of\\n    how it all works.</p>\\n  <docs-example language=\\\"markup\\\">\\n    <!-- Stack the columns on mobile by making one full-width and the other half-width -->\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-xs-12 col-md-8\\\">.col-xs-12 .col-md-8</div>\\n      <div class=\\\"col-xs-6 col-md-4\\\">.col-xs-6 .col-md-4</div>\\n    </div>\\n\\n    <!-- Columns start at 50% wide on mobile and bump up to 33.3% wide on desktop -->\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-xs-6 col-md-4\\\">.col-xs-6 .col-md-4</div>\\n      <div class=\\\"col-xs-6 col-md-4\\\">.col-xs-6 .col-md-4</div>\\n      <div class=\\\"col-xs-6 col-md-4\\\">.col-xs-6 .col-md-4</div>\\n    </div>\\n\\n    <!-- Columns are always 50% wide, on mobile and desktop -->\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-xs-6\\\">.col-xs-6</div>\\n      <div class=\\\"col-xs-6\\\">.col-xs-6</div>\\n    </div>\\n  </docs-example>\\n\\n  <h3 class=\\\"heading-medium\\\" id=\\\"grid-example-mixed-complete\\\">Example: Mobile, tablet, desktop</h3>\\n  <p>Build on the previous example by creating even more dynamic and powerful layouts with tablet <code>.col-sm-*</code> classes.</p>\\n  <docs-example language=\\\"markup\\\">\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-xs-12 col-sm-6 col-md-8\\\">.col-xs-12 .col-sm-6 .col-md-8</div>\\n      <div class=\\\"col-xs-6 col-md-4\\\">.col-xs-6 .col-md-4</div>\\n    </div>\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-xs-6 col-sm-4\\\">.col-xs-6 .col-sm-4</div>\\n      <div class=\\\"col-xs-6 col-sm-4\\\">.col-xs-6 .col-sm-4</div>\\n      <!-- Optional: clear the XS cols if their content doesn't match in height -->\\n      <div class=\\\"clearfix visible-xs-block\\\"></div>\\n      <div class=\\\"col-xs-6 col-sm-4\\\">.col-xs-6 .col-sm-4</div>\\n    </div>\\n  </docs-example>\\n\\n  <h3 class=\\\"heading-medium\\\" id=\\\"grid-example-wrapping\\\">Example: Column wrapping</h3>\\n  <p>If more than 12 columns are placed within a single row, each group of extra columns will, as one unit, wrap onto a new line.</p>\\n  <docs-example language=\\\"markup\\\">\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-xs-9\\\">.col-xs-9</div>\\n      <div class=\\\"col-xs-4\\\">.col-xs-4<br>Since 9 + 4 = 13 &gt; 12, this 4-column-wide div gets wrapped onto a new line as one contiguous unit.</div>\\n      <div class=\\\"col-xs-6\\\">.col-xs-6<br>Subsequent columns continue along the new line.</div>\\n    </div>\\n  </docs-example>\\n\\n  <h3 class=\\\"heading-medium\\\" id=\\\"grid-responsive-resets\\\">Responsive column resets</h3>\\n  <p>With the four tiers of grids available you're bound to run into issues where, at certain breakpoints, your columns\\n    don't clear quite right as one is taller than the other. To fix that, use a combination of a <code>.clearfix</code> and our responsive utility classes.</p>\\n  <docs-example language=\\\"markup\\\">\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-xs-6 col-sm-3\\\">.col-xs-6 .col-sm-3</div>\\n      <div class=\\\"col-xs-6 col-sm-3\\\">.col-xs-6 .col-sm-3</div>\\n\\n      <!-- Add the extra clearfix for only the required viewport -->\\n      <div class=\\\"clearfix visible-xs-block\\\"></div>\\n\\n      <div class=\\\"col-xs-6 col-sm-3\\\">.col-xs-6 .col-sm-3</div>\\n      <div class=\\\"col-xs-6 col-sm-3\\\">.col-xs-6 .col-sm-3</div>\\n    </div>\\n  </docs-example>\\n  <p>In addition to column clearing at responsive breakpoints, you may need to reset offsets, pushes, or pulls.</p>\\n  <prismify language=\\\"markup\\\">\\n    <div class=\\\"row\\\">\\n      <div class=\\\"col-sm-5 col-md-6\\\">.col-sm-5 .col-md-6</div>\\n      <div class=\\\"col-sm-5 col-sm-offset-2 col-md-6 col-md-offset-0\\\">.col-sm-5 .col-sm-offset-2 .col-md-6 .col-md-offset-0</div>\\n    </div>\\n\\n    <div class=\\\"row\\\">\\n      <div class=\\\"col-sm-6 col-md-5 col-lg-6\\\">.col-sm-6 .col-md-5 .col-lg-6</div>\\n      <div class=\\\"col-sm-6 col-md-5 col-md-offset-2 col-lg-6 col-lg-offset-0\\\">.col-sm-6 .col-md-5 .col-md-offset-2 .col-lg-6 .col-lg-offset-0</div>\\n    </div>\\n  </prismify>\\n\\n  <h3 class=\\\"heading-medium\\\" id=\\\"grid-offsetting\\\">Offsetting columns</h3>\\n  <p>Move columns to the right using <code>.col-md-offset-*</code> classes. These classes increase the left margin of a column by *\\n    columns. For example, <code>.col-md-offset-4</code> moves <code>.col-md-4</code> over four columns.</p>\\n  <docs-example language=\\\"markup\\\">\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-md-4\\\">.col-md-4</div>\\n      <div class=\\\"col-md-4 col-md-offset-4\\\">.col-md-4 .col-md-offset-4</div>\\n    </div>\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-md-3 col-md-offset-3\\\">.col-md-3 .col-md-offset-3</div>\\n      <div class=\\\"col-md-3 col-md-offset-3\\\">.col-md-3 .col-md-offset-3</div>\\n    </div>\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-md-6 col-md-offset-3\\\">.col-md-6 .col-md-offset-3</div>\\n    </div>\\n  </docs-example>\\n  <p>You can also override offsets from lower grid tiers with .col-*-offset-0 classes.</p>\\n  <prismify language=\\\"markup\\\">\\n    <div class=\\\"row\\\">\\n      <div class=\\\"col-xs-6 col-sm-4\\\">\\n      </div>\\n      <div class=\\\"col-xs-6 col-sm-4\\\">\\n      </div>\\n      <div class=\\\"col-xs-6 col-xs-offset-3 col-sm-4 col-sm-offset-0\\\">\\n      </div>\\n    </div>\\n  </prismify>\\n  <h3 class=\\\"heading-medium\\\" id=\\\"grid-nesting\\\">Nesting columns</h3>\\n  <p>To nest your content with the default grid, add a new <code>.row</code> and set of <code>.col-sm-*</code> columns\\n    within an existing <code>.col-sm-* </code>column. Nested rows should include a set of columns that add up to 12 or\\n    fewer (it is not required that you use all 12 available columns).</p>\\n  <docs-example language=\\\"markup\\\">\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-sm-9\\\">\\n        Level 1: .col-sm-9\\n        <div class=\\\"row\\\">\\n          <div class=\\\"col-xs-8 col-sm-6\\\">\\n            Level 2: .col-xs-8 .col-sm-6\\n          </div>\\n          <div class=\\\"col-xs-4 col-sm-6\\\">\\n            Level 2: .col-xs-4 .col-sm-6\\n          </div>\\n        </div>\\n      </div>\\n    </div>\\n  </docs-example>\\n  <h3 class=\\\"heading-medium\\\" id=\\\"grid-column-ordering\\\">Column ordering</h3>\\n  <p>Easily change the order of our built-in grid columns with <code>.col-md-push-*</code> and\\n    <code>.col-md-pull-*</code> modifier classes.</p>\\n  <docs-example language=\\\"markup\\\">\\n    <div class=\\\"row show-grid\\\">\\n      <div class=\\\"col-md-9 col-md-push-3\\\">.col-md-9 .col-md-push-3</div>\\n      <div class=\\\"col-md-3 col-md-pull-9\\\">.col-md-3 .col-md-pull-9</div>\\n    </div>\\n  </docs-example>\\n\\n</main><!-- / #content -->\";//# sourceMappingURL=data:application/json;charset=utf-8;base64,");

